import React from 'react';
import Title from './components/Title.jsx';
import Choise from './components/Choise.jsx'
import Inputs_left from './components/Inputs-left.jsx';
import Inputs_right from './components/Inputs-right.jsx';
import './App.css';

const style_inline = {
  display: 'inline-block',
}


const App = () => {
  return (<>
    <Title />
    <Choise />
    <div style={style_inline}>
      <Inputs_left />
      <Inputs_right />
    </div>

  </>
  )
}

export default App;
